import './App.css';
import React from 'react';

import PostsList from './componenets/PostsList';
import {  
    BrowserRouter as Router,  
    Routes,  
    Route,  
    Link  
}   from "react-router-dom";
import PostForm from './componenets/PostForm';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
      <Routes>

        <Route path="/">

            <PostForm></PostForm>

        </Route>

        <Route path="/list">
            <PostsList />
        </Route>
      </Routes>



      <Link to="/list">
      <button>Show ALL</button>
      </Link>
    </ div>
    </BrowserRouter>



  );
}

export default App;
